import { Container, Row, Col } from 'react-grid-system';


export default () => {
    return <div>
        <style global jsx>{`
        body {
          margin: 0;
          padding: 0;
          background: #FCF9E9;
          -moz-osx-font-smoothing: grayscale;
          -webkit-font-smoothing: antialiased;
          -webkit-backface-visibility: hidden;
          font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
        }
        a{
            color: black;
        }
        .menu_items a{
            margin-left: 13px;
        }
      `}</style>
        <div style={{ height: 70 }}>
            <Container>
                <Row>
                    <Col sm={6} md={6} style={{ lineHeight: "70px" }}><img width="150" src="/logo.svg" /></Col>
                    <Col className="menu_items" sm={6} md={6} style={{ textAlign: "right", lineHeight: "70px" }}>
                        <a href="#">Terms of use</a>
                        <a href="#">About us</a>
                        <a href="#">Feedback</a>
                    </Col>
                </Row>
            </Container>
        </div>
    </div>
}
